import React from 'react';
import Navbar from './Navbar';

const MealRecord = () => {
    return (
        <div>
            <Navbar/>
            <div className="divcss">
                <h2>Meal Record page</h2>
                <form>
                    <label>Choose User Profile</label>
                    <input type="checkbox" id="User Profile 1" name="User Profile 1" value="User Profile 1">User Profile 1</input>
                    <label>Choose stall</label>
                    <input type='text'></input>
                    <label>Choose food</label>
                    <input type='text'></input>
                    <label>Food nutritional value</label>
                    <input type='text'></input>
                    <button>Create a meal</button><br></br>
                    <button>View meal history</button>

                </form>    
            </div>     
        </div>
    );
};

export default MealRecord;
